        "description": "Germany and the United States will send armored vehicles to Ukraine, the leaders of the two countries said in a joint statement. The announcement came after a phone call between German Chancellor Olaf Scholz and President Joe Biden on Thursday. Ukrainian President Volodymyr Zelenskyy has asked for the vehicles to significantly increase his military's firepower in the ongoing war with Russia. The US would provide Bradley Infantry Fighting Vehicles, while Germany would supply Marder Infantry Fighting Vehicles, the two nations said. Germany would also send a Patriot missile system, following Washington's donation last month, to help repel Russian missile and drone attacks. Scholz and Biden added they would welcome allies' \"additional donations of air defense systems and combat vehicles.\" Germany didn't specify how many Marder vehicles would be suppliedbut Der Spiegel reported it could be as many as 40.\n\nTwo US officials said the US weapons package for Ukraine would include about 50 Bradley Fighting Vehicles. Also included would be Humvees and a large number of missiles and other ammunition. So far, Germany has agreed to supply Ukraine with \"Gepard\" anti-aircraft tanks but not the Marder infantry fighting vehicles Kyiv has repeatedly asked for. The West's hesitation in sending advanced armaments has revolved around fears of provoking Russia. Earlier France announced that it would be sending \"light tanks.\"\n\nSubscribe: https://www.youtube.com/user/deutschewelleenglish?sub_confirmation=1\n\nFor more news go to: http://www.dw.com/en/\nFollow DW on social media:\nâ–ºFacebook: https://www.facebook.com/deutschewellenews/\nâ–ºTwitter: https://twitter.com/dwnews\nâ–ºInstagram: https://www.instagram.com/dwnews\nâ–ºTwitch: https://www.twitch.tv/dwnews_hangout\nFÃ¼r Videos in deutscher Sprache besuchen Sie: https://www.youtube.com/dwdeutsch\n#Urkaine #Marder #leopardtank",
